    def test_flex_tech(self):
        expected_ac_size = 0.817

        resp = self.api_client.post(self.submit_url, format='json', data=self.post)
        uuid = json.loads(resp.content)['run_uuid']
        response = json.loads(self.api_client.get(self.results_url.replace('<run_uuid>', str(uuid))).content)
        # response = self.get_response(self.post)

        ac_out = response['outputs']['Scenario']['Site']['FlexTechAC']
        messages = response['messages']

        try:
            self.assertEqual(ac_out['size_kw'], expected_ac_size,
                             "AC size ({}) does not equal expected AC size ({})."
                             .format(ac_out['size_kw'], expected_ac_size))

        except Exception as e:
            error_msg = None
            if hasattr(messages, "error"):
                error_msg = messages.error
            print("test_flex_tech API error message: {}".format(error_msg))
            print("Run uuid: {}".format(response['outputs']['Scenario']['run_uuid']))
            raise e
